import shield from './photos/barclay_shield.png';

const Navigation = () => {
  return (
    <div className="navigation-div">
    <nav>
      <h1>MEET DAVE</h1>
      <h1>RESUME</h1>
      <h1>PROJECTS</h1>
      <h1>LET'S CONNECT</h1>
    </nav>
    <div>
    <img src={shield} alt="shield" />
    <h1 id="david-title">DAVID BARCLAY GURULE</h1>
    </div>
    </div>
  );
}

export default Navigation;
